import React from 'react';
import NewCoinsTrackerCard from '../components/NewCoinsTrackerCard';
import WalletTrackerCard from '../components/WalletTrackerCard';
import VolumeTrackerCard from '../components/VolumeTrackerCard';
import TestWebSocket from '../components/TestWebSocket';
import WatchedCoinsCard from '../components/WatchedCoinsCard';
import CardWrapper from '../components/CardWrapper';

function Home() {
console.log('Home component mounted');
return (
    <div className="p-6">
        <div className="mb-12 text-center">
        <h1 className="text-4xl font-bold mb-4 text-gray-900 dark:text-white">Crypto Dashboard</h1>
        <p className="text-lg text-gray-600 dark:text-gray-300">Track your crypto assets, monitor market changes, and stay updated with the latest trends</p>
    </div>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <CardWrapper title="New Coins" subtitle="Track newly listed cryptocurrencies">
            <NewCoinsTrackerCard />
        </CardWrapper>
        <CardWrapper title="Wallet Tracker" subtitle="Monitor your crypto portfolio">
            <WalletTrackerCard />
        </CardWrapper>
        <CardWrapper title="Volume Tracker" subtitle="Track trading volume changes">
            <VolumeTrackerCard />
        </CardWrapper>
        <CardWrapper title="Real-time Data" subtitle="Live cryptocurrency updates">
            <TestWebSocket />
        </CardWrapper>
        <CardWrapper title="Watched Coins" subtitle="Your monitored cryptocurrencies">
            <WatchedCoinsCard />
        </CardWrapper>
    </div>
</div>
);
}

export default Home;
